import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PipelineSimulation from './PipelineSimulation'; // Import the pipeline page
import AssetOverview from './AssetOverview'; // Import the overview page

const App = () => {
    return (
        <Router>
            <div style={{ padding: '20px', fontFamily: 'Arial' }}>
                <h1>Asset Management System</h1>
                {/* Navigation Links */}
                <nav style={{ marginBottom: '20px' }}>
                    <Link to="/" style={{ marginRight: '15px' }}>Pipeline Simulation</Link>
                    <Link to="/overview">Asset Overview</Link>
                </nav>

                {/* Routes */}
                <Routes>
                    <Route path="/" element={<PipelineSimulation />} />
                    <Route path="/overview" element={<AssetOverview />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
